title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o7676.m2 -> o7659.m1 -> o7676.m0 -> o7659.m3 -> o7659.m1
  o7659.m1 -> o7676.m0 -> o7659.m3 -> o7659.m1
  o7676.m0 -> o7659.m3 -> o7659.m1 -> o7676.m0
  o7659.m3 -> o7659.m1 -> o7676.m0 -> o7659.m3
  o7703.m20 -> o7712.m16 -> o7703.m20
  o7712.m16 -> o7703.m20 -> o7712.m16
  o7712.m3 -> o7703.m20 -> o7712.m16 -> o7703.m20

features:
  - inheritance
  - overriding
  - method
  - polymorphism

